  `com_interest` varchar(11) DEFAULT '' COMMENT '日利率(不包含百分号)',
  `term_scope` varchar(55) DEFAULT '' COMMENT '还款期限（7-14天）',
  `repayment_method` varchar(55) DEFAULT '' COMMENT '所支持的还款方式（分期）',
