  `audit_certificatio` varchar(255) DEFAULT '' COMMENT '审核认证',
  `repayment_statemen` varchar(255) DEFAULT '' COMMENT '还款说明',
  `backstage_url` varchar(255) DEFAULT '' COMMENT '后台登录网址',
  `backstage_admin` varchar(20) DEFAULT '' COMMENT '后台登录帐号用户名',
  `backstage_password` varchar(55) DEFAULT '' COMMENT '后台登录密码',
  `com_logo` varchar(60) DEFAULT '' COMMENT '品牌logo图片地址',
  `state` int(11) DEFAULT '0' COMMENT '商品状态\r\n0：上架中\r\n5：已下架',
  `characteris_dic_id` varchar(40) DEFAULT '' COMMENT '商品分类ID（字典表中的dic_id）商品分类如（1、低息通过率高2、小额急速）',
  `isdisplay` int(11) DEFAULT '0' COMMENT '删除标记（0：正常 5：已删除）',
  `settlement` int(10) DEFAULT '0' COMMENT '结算方式（0：预付  1：日结）',
  `create_time` datetime DEFAULT NULL,
  `remarks` varchar(255) DEFAULT '',
  `update_time` datetime DEFAULT NULL COMMENT '上架下架修改时间',
  PRIMARY KEY (`com_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品\r\n';

