  `user_id` varchar(40) DEFAULT '' COMMENT '个推给某个用户，用户ID',
  `create_time` datetime DEFAULT NULL,
  `remarks` varchar(255) DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`up_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='消息推送表';

